import Axios  from 'axios';
import React, { useState } from 'react'
import Campsquerrycard from './Campsquerrycard'

function Campsq() {

    const url = "http://localhost:3001";
    const [data, setdata] = useState([]);
  
    Axios.get (`${url}/campq`)
  .then(res=>{
  
     setdata(res.data) 
    
    
  })
  




  return (
    <div>

      <div>
        {data.map(one=><Campsquerrycard {...one}   />)}
      </div>
        
        

    </div>
  )
}

export default Campsq
